import React, { useState } from 'react';
import { StyleSheet, Text, View, SafeAreaView, Image , TextInput} from 'react-native';
import Slider from '@react-native-community/slider';

export default function App() {
  const [size,setSize] = useState(5);

  return (
    <SafeAreaView style={styles.container}>
      <Image style={styles.logo} source={require('./assets/locked.png')}/>
      <TextInput style={styles.input}/>
      <View style={styles.slideBarContainer}>
        <Text style={styles.label}>Size: {size} characters</Text>
        <Slider
          style={{width: 270, height: 50}}
          minimumValue={5}
          maximumValue={20}
          minimumTrackTintColor="#f5f5f5"
          maximumTrackTintColor="#DDDDDD"
          value={size}
          onValueChange={value => setSize(Number(value.toFixed(0)))}
        />
      </View>
    </SafeAreaView>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#355070',
    alignItems: 'center',
    justifyContent: 'center',
  },
  logo:{
    height: 100,
    width: 100
  },
  input:{
    width: 300,
    height: 60,
    backgroundColor: '#DDDDDD',
    borderColor: '#f5f5f5',
    borderWidth: 5,
    borderRadius: 10,
    borderStyle: 'dashed',
    paddingHorizontal: 15,
    fontSize: 30,
    color: '#f5f5f5',
  },
  slideBarContainer:{
    alignItems: 'center',
    height: 10,
    margin: 0
  },
  label:{
    fontSize: 25,
    color: '#f5f5f5',
    letterSpacing: 1.5,
    fontFamily: 'UbuntuCondensed'
  }
});
